import { BrowserRouter } from 'react-router-dom';
import { StateProvider } from './StateProvide';
import { initialState } from "./reducer";

ReactDOM.render(
  <BrowserRouter>
  <StateProvider initialState={initialState} reducer={reducer}>
  <App />
  </StateProvider>
  </BrowserRouter>
